import React from 'react';

function Footer() {
    return(
        <div id="footer" className="row">
            <div className="offset-1">
                <p className="text-muted credit">
                    <center>All Finn laws can be found from <a href="https://www.finlex.fi/fi/">Finlex</a> and are in public domain.</center>
                </p>
            </div>
        </div>
    );
};

export default Footer;
